import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import html from './images/html-5.svg'

class Home extends React.Component{
    constructor(props){
        super(props)
    }

    render(){
        return (
            <div className="container">
        <div className="col-lg-8 col-lg-offset-2 col-md-8 col-md-offset-2 col-sm-12">
          <div className="title">
            <h1>Stephen Doyle</h1>
            <h1>Developer</h1>
          </div>
          <div className="images">
            <img className="logo" src={html} alt="HTML5" />
            <img className="logo" src="images/css-3.svg" alt="CSS3" />
            <img className="logo" src="images/javascript-4.svg" alt="JavaScript" />
            <img className="logo" src="images/bootstrap-4.svg" alt="Bootstrap" />
            <img className="logo" src="images/sass.svg" alt="Sass" />
            <img className="logo" src="images/npm.svg" alt="NPM" />
            <img className="logo" src="images/nodejs.svg" alt="Node.js" />
            <img className="logo" src="images/mongodb.svg" alt="MongoDB" />
          </div>
          <br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br />
        </div>
      </div>



        )
    }
}

export default Home
